INSERT INTO `role` (`Role_Name`, `Role_Desc`) VALUES('Account Manager', 'The Account Manager acts as a key point of contact between an organisation and its clients. He/She possesses thorough product knowledge and oversees product and/or service sales. He works with customers to identify their wants and prepares reports by collecting, analysing, and summarising sales information. He contacts existing customers to discuss and give recommendations on how specific products or services can meet their needs. He maintains customer relationships to strategically place new products and drive sales for long-term growth. He works in a fast-paced and dynamic environment, and travels frequently to clients'' premises for meetings. He is familiar with client relationship management and sales tools. He is knowledgeable of the organisation''s products and services, as well as trends, developments and challenges of the industry domain. The Sales Account Manager is a resourceful, people-focused and persistent individual, who takes rejection as a personal challenge to succeed when given opportunity. He appreciates the value of long lasting relationships and prioritises efforts to build trust with existing and potential customers. He exhibits good listening skills and is able to establish rapport with customers and team members alike easily.');
INSERT INTO `role` (`Role_Name`, `Role_Desc`) VALUES('Admin Executive', 'Admin Executive will act as the point of contact for all employees, providing administrative support and managing their queries. Main duties include managing office stock, preparing regular reports (e.g. expenses and office budgets) and organizing company records. If you have previous experience as an Office Administratoror similar administrative role, we''d like to meet you. ');
INSERT INTO `role` (`Role_Name`, `Role_Desc`) VALUES('Call Centre', 'Call Centre Executive is responsible for providing assistance to customers by addressing their queries and requests. He/She advises customers on appropriate products and services based on their needs. He is responsible for the preparation of customer documentation. In the case of complex customer requests, he escalates them to senior officers. He is able to abide by safety and/or security standards in the workplace.\r\n\r\nThe Call Centre Executive  pays strong attention to details to verify and process documentation. He also shows initiative and quick decision-making skills to provide excellent personalised customer services and support. He is comfortable with various stakeholder interactions whilst working in shifts and possesses adequate computer literacy to process customer documentation. ');
INSERT INTO `role` (`Role_Name`, `Role_Desc`) VALUES('Consultancy Director', 'The  Director defines and articulates the organisation''s strategy for securing technical wins with prospective clients. He/She focuses on developing key growth  strategies, tactics and action plans required to achieve revenue and/or sales targets. He advises the team on developing prototypes to ensure feasibility of solutions, and oversees the delivery of in-depth presentations and product demonstrations to clients. He solves complex problems and evaluates clients needs with different perspectives. He works in a fast-paced and dynamic environment, and travels frequently to clients'' premises for technical sales pitches and meetings. He is familiar with client relationship management and sales tools. He possesses deep product and technical knowledge, and is knowledgeable of the trends, developments and challenges of the industry domain. The  Director is target-driven and client centric, and has the ability to foster collaboration between stakeholders. He has a deep understanding of key business industries and knowledge of products and services in the market. He is strongly committed to developing talent and inspires his team members to pursue a common vision.');
INSERT INTO `role` (`Role_Name`, `Role_Desc`) VALUES('Consultant', 'The Consultant is responsible for providing Sales technical expertise to the sales team and clients during the sales process. He/She delivers presentations and technical demonstrations of the organisation''s products to prospective clients. He translates the client''s business requirements into technical specifications and requirements, and provides technical inputs for proposals, tenders, bids and any relevant documents. He uses prescribed guidelines or policies to analyse and solve problems. He works in a fast-paced and dynamic environment, and travels frequently to clients'' premises for technical sales pitches and meetings. He is familiar with client relationship management and sales tools. He possesses deep product and technical knowledge, and is knowledgeable of the trends, developments and challenges of the industry domain. The Sakes Consultant displays effective listening skills and is inquisitive in nature. He possesses deep technical and domain knowledge, pays attention to detail, and has strong analytical and problem-solving capabilities. He has a service-oriented personality and is a team player who works towards developing solutions collaboratively.');
INSERT INTO `role` (`Role_Name`, `Role_Desc`) VALUES('Developer', 'The Developer leads important projects and possesses capability to make breakthroughs in design, development, testing, debugging and implementing software applications or specialised utility programs in support of end users'' needs on platforms. He/She plans and coordinates regular updates and recommends improvements to existing applications. He identifies and resolves issues which have organisation wide and long-term impact. He identifies security risks, creates requirements to capture security issues, and performs initial threat modelling to ensure coding standards meets security requirements. He develops and maintains the software configuration management plan and oversees the building, verification and implementation of software releases. He provides guidance and technical support to the quality testing teams. He works in a team setting and is proficient in programming languages required by the organisation. He is familiar with software development tools and standards, as well as the relevant software platforms on which the solution is deployed on. The Developer is imaginative and creative in exploring a range of application designs and solutions. He is able to engage and support others in the team, readily put forth his ideas in a clear and compelling manner.');
INSERT INTO `role` (`Role_Name`, `Role_Desc`) VALUES('Engineering Director', 'The Engineering Director is responsible for spearheading the strategic planning, design and implementation of complex engineering solutions to meet customers requirements. He/She drives direction and strategy for the development and execution of engineering projects, and ensures alignment to the organisational strategy, vision and mission. He formulates strategies and frameworks to drive workplace health, safety, risk and environmental management in accordance with local and international regulations. He develops the organisations technology roadmap and drives continuous improvement strategies. In addition, he leverages his deep technical expertise and industry experience to develop technical capabilities and domain expertise for the organisation. He is a professional engineer, specialising in mechanical, electrical, control and instrumentation, civil, structural or geotechnical engineering disciplines.\r\n\r\nHe is the organisations technical expert who advises senior management and business partners on complex engineering matters. He maintains and builds strong links with the external engineering community and establishes best practises in the implementation of engineering standards and design. He is a strategic and creative thinker, demonstrates exceptional leadership and problem-solving skills, and establishes strategic partnerships.');
INSERT INTO `role` (`Role_Name`, `Role_Desc`) VALUES('Finance  Executive', 'The Finance Executive supports the finance department in carrying out the responsibilities of the accounting department. He/She is involved in work that is specific to accounts receivable, accounts payable, tax filing, data compilation, billing, payroll or other accounting tasks. In some instances, he may work specifically with accruals, fixed assets accounting or the monthly and yearly finalisation of accounts for audit purposes. The Accounts Executive/Accounts Assistant may also assist with the preparation of trial balance, basic financial statements and simple consolidated financial statements. He may be called on to participate in ad-hoc finance-related projects and systems testing when necessary.');
INSERT INTO `role` (`Role_Name`, `Role_Desc`) VALUES('Finance Director', 'The Finance Director is the business partner for all the business units in an organisation. He/She serves as the organisations go-to person for all matters related to accounting. He provides technical accounting advice to various stakeholders to maximise organisation''s value and minimise risks in accordance with external and internal accounting guidance. The Business Controller/Finance Director demonstrates excellent people skills to facilitate the on-going business relationships and find new business opportunities. He also play a critical role in financial planning and analysis supporting key management decisions which includes involvement in providing operational risk management support to the business and ensuring proper business performance management through profitability and operational analysis. In addition, he is involved in recruitment, performance management, appraisal and identifying training and development needs for the business units in an organisation.');
INSERT INTO `role` (`Role_Name`, `Role_Desc`) VALUES('Finance Manager', 'The Finance Manager is the lead finance business partner for the organisation and has responsibilities covering all aspects of financial management, performance management, financial accounting, budgeting, corporate reporting etc. He/she has sound technical as well as management skills and be able to lead a team consisting of finance professionals with varied, in-depth or niche technical knowledge and abilities; consolidating their work and ensuring its quality and accuracy, especially for reporting purposes. The Finance Manager is expected to provide sound financial advice and counsel on working capital, financing or the financial position of the organisation by synthesising internal and external data and studying the economic environment. He often has a key role in implementing best practices in order to identify and manage all financial and business risks and to meet the organisation''s desired business and fiscal goals. He is expected to have a firm grasp of economic and business trends and to implement work improvement projects that are geared towards quality, compliance and efficiency in finance.');
INSERT INTO `role` (`Role_Name`, `Role_Desc`) VALUES('HR Director', 'TheHR Director is responsible for establishing the overall talent management strategies and frameworks to identify, prepare and position the right talent to drive organisational success. He/She formulates career development frameworks and programmes to provide fulfilling career opportunities to employees in the organisation. He liaises with senior business stakeholders to formulate robust succession plans for business-critical roles in the organisation, ensuring future viability and alignment with business plans and direction. He is responsible for establishing retirement and exit policies and guidelines, and evaluating the business impact of redundancy, retirement and exit decisions. He also guides and advises senior business leaders in the management and communication of sensitive talent decisions. As a department head, he is responsible for setting the direction and articulating goals and objectives for the team, and driving the integration of Skills Frameworks across the organisation''s talent management plans.\r\n\r\nThe HR Director is a forward-thinking and influential leader who is able to integrate knowledge across diverse domains to make robust decisions and address multi-faceted issues effectively. He has the desire to motivate employees and develop talent capabilities both within the team and across the organisation, and demonstrates sensitivity and diplomacy when interacting with stakeholders at various levels.');
INSERT INTO `role` (`Role_Name`, `Role_Desc`) VALUES('HR Executive', 'HR Team executes planned talent outreach and engagement activities to source for potential candidates and maintains an optimal experience for employees. He/She conducts the initial screening of potential candidates, administers assessments and prepares employment contracts as per guidelines. He tracks the conversion success rate for each sourcing channel and provides administrative and logistical support during onboarding. He administers employee engagement surveys and collates responses and feedback while ensuring confidentiality of information provided.\r\n\r\nHR Team Executive enjoys working in a team environment and interacts proactively with various stakeholders. He has a service-oriented mindset and can adapt to various forms of technology within his work space to enhance his work. ');
INSERT INTO `role` (`Role_Name`, `Role_Desc`) VALUES('IT Analyst', 'IT Analyst performs routine infrastructure operations and maintenance activities. He/She assists with monitoring infrastructure performance. He checks for problems in existing systems and modifies work processes by following defined procedures, processes and quality standards. He is required to be on standby with on-call availability with varied shifts including nights, weekends and holidays. He works in a team setting and is proficient in infrastructure systems and network-related tools and techniques required by the organisation. He is also familiar with the relevant software platforms on which the database is deployed. The Associate Infrastructure Support Engineer is able to solve issues quickly and effectively as they arise. He is able to methodically identify the cause of the issue, evaluate it and develop a solution in collaboration with the team. He is able to communicate effectively and displays high service level standards.');
INSERT INTO `role` (`Role_Name`, `Role_Desc`) VALUES('IT Director', 'The IT Director drives the vision and strategy for the IT Operations and Support functions. He/She sets the direction for systems and database administration, day-to-day IT support and operations, data centre operations and system and quality assurance through the delivery of services as per business requirements; controls costs and manages vendors. He is responsible for formulating strategies for service level agreements. He ensures compliance with organisation''s quality standards, international standards and government regulations. He is a leader with the energy and commitment to drive large teams toward achieving service level excellence. He is familiar with enterprise architecture frameworks, database administration and systems, and application monitoring tools. The Head of Operations and Support has a broad sense of perspective with the ability to influence key internal and external stakeholders. He is strategic in his approach to managing resources and developing capabilities within the team. He is effective in setting direction aligned to the strategic positioning of the business and the IT functions overall. He is able to impress upon the team the need to continuously improve service levels and increase efficiencies.');
INSERT INTO `role` (`Role_Name`, `Role_Desc`) VALUES('Junior Engineer', 'The Junior Engineerapplies engineering principles and techniques to optimise the equipment and systems within the manufacturing facility. He/She provides technical guidance and direction for the installation of equipment and systems. He develops plans for the maintenance of equipment and systems, and recommends engineering solutions to troubleshoot faults. The Junior Engineerinnovates equipment and systems, and contributes to manufacturing equipment and systems improvement projects by conducting feasibility assessments and tests on new technologies. He is also expected to manage energy resources and utilities by developing solutions to optimise machine availability and energy efficiency. The Junior Engineermust ensure compliance with Standard Operating Procedures (SOPs), Health, Safety and Environment (HSE) regulations and Current Good Manufacturing Practices (CGMPs) within his purview. He develops guidelines and conducts equipment qualification and validation in line with biopharmaceuticals manufacturing regulatory requirements. \r\n\r\nThe Junior Engineershould possess an enquiring and analytical mind and have a knack for investigating issues, analysing multifaceted engineering problems and developing solutions. He must also be a strong team player who can guide and mentor others, and communicate technical advices and solutions to colleagues beyond the team.');
INSERT INTO `role` (`Role_Name`, `Role_Desc`) VALUES('L&D Executuve', 'The L&D Executive assists in procuring training programmes and documenting learning needs in the \r\norganisation, maintaining organisations'' learning systems and provides administrative support in conducting learning programmes. He/She manages resources and logistics for delivering learning programmes and collects data from learning evaluation surveys to measure learning programmes effectiveness. He supports the conduct of assessments to identify high-potential talent in the organisation, and documents assessment records and succession plans for critical roles identified. He also responds to employee queries that are related to assessments and learning programmes. He is responsible for maintaining exit and retirement records.\r\n\r\nTheL&D Executive enjoys working in a team environment and interacts proactively with various stakeholders. He is eager to explore and analyse problems, and is able to communicate information in a clear and concise manner to meet others'' needs at the workplace.');
INSERT INTO `role` (`Role_Name`, `Role_Desc`) VALUES('Ops Planning Exec', 'The Operation Planning Executive upports plant operations by coordinating day-to-day production activities, as well as maintenance and turnaround schedules and activities, for production shift teams, so as to meet production plans and schedules.');
INSERT INTO `role` (`Role_Name`, `Role_Desc`) VALUES('Sales Director', 'The Sales Director determines sales targets, markets and product offering. He/She focuses on revenue target setting accountability, sales strategy and career development of others, liaising with professional staff and other managers on the medium- to long-term sales planning. He develops, communicates and implements the operational strategy, regularly leads important sales initiatives and has ultimate accountability for the sales function. He oversees the preparation and presentation of technical proposals and ensures that the complete plans are feasible within cost, time, and environmental constraints. He drives product differentiation and optimises the use of resources, evaluates partnership effectiveness, and advises on corrective action. He solves complex problems and adopts new perspectives to drive sales. He works in a fast-paced and dynamic environment, and travels to clients'' premises for sales pitches and negotiations. He is familiar with client relationship management and sales tools, as well as sales operations and business practices. He knowledgeable of the trends, developments and challenges of the industry domain. The Sales Director is creative and self-motivated, and is dedicated to growing the business. He contributes his expertise to product development and brainstorming of marketing campaigns, as needed. He is a competent decision maker who exhibits flexibility amidst a rapidly changing environment. He strives to train talent and build successful teams.');
INSERT INTO `role` (`Role_Name`, `Role_Desc`) VALUES('Sales Manager', 'The Sales Manager is responsible for managing the organisation''s sales growth. By analysing client segmentation and competitor landscape, he/she develops sales strategies. He supports lead generation, and conducts business and contract negotiations to increase client acquisition and boost retention. \r\n\r\nInnovative and resourceful, he demonstrates initiative in identifying new opportunities both locally and regionally and converting them into actual sales. He builds good rapport with new and existing clients by pro-actively anticipating clients'' needs and identifying business solutions to meet those needs. He networks extensively outside of the office to stay in close contact with the key industry stakeholders.');
INSERT INTO `role` (`Role_Name`, `Role_Desc`) VALUES('Senior Engineer', 'The Senior Engineer applies advanced engineering principles and techniques to troubleshoot complex engineering problems encountered within the manufacturing facility and provides expert technical advice to guide the installation and maintenance of equipment and systems. He/She is expected to lead the technical cross-collaboration with the Process Development/Manufacturing Science and Technology (PD/MSAT) department in order to identify appropriate biopharmaceuticals manufacturing equipment and optimise their functionalities. The Senior Engineer leads manufacturing equipment and systems innovation projects by guiding feasibility assessments and tests on new technologies. He is expected to review and approve solutions and initiatives to optimise machine availability while managing energy and utility use. He sets parameters for equipment qualification and validation in line with biopharmaceuticals manufacturing regulatory requirements. The Principal/Engineer must ensure compliance with Standard Operating Procedures (SOPs), Health, Safety and Environment (HSE) regulations and Current Good Manufacturing Practices (CGMPs) within his purview.\r\n\r\nThe Engineering and Maintenance Principal/Engineer carries the responsibility of the in-house technical expert. He should possess a deep passion for analysing and resolving multifaceted engineering problems and be able to apply advanced critical and analytical thinking skills to deal with immediate situations. He should have a developmental and amiable approach in his interactions working as part of a team while guiding and mentoring others. He must also be able to communicate engineering concepts in a manner that will be understood by others within and beyond the team.');
INSERT INTO `role` (`Role_Name`, `Role_Desc`) VALUES('Solutioning Director', 'The Solutioning Director defines and articulates the organisation''s strategy for securing technical wins with prospective clients. He/She focuses on developing key growth pre-sales strategies, tactics and action plans required to achieve revenue and/or sales targets. He advises the team on developing prototypes to ensure feasibility of solutions, and oversees the delivery of in-depth presentations and product demonstrations to clients. He solves complex problems and evaluates clients needs with different perspectives. He works in a fast-paced and dynamic environment, and travels frequently to clients'' premises for technical sales pitches and meetings. He is familiar with client relationship management and sales tools. He possesses deep product and technical knowledge, and is knowledgeable of the trends, developments and challenges of the industry domain. The Pre-Sales Director is target-driven and client centric, and has the ability to foster collaboration between stakeholders. He has a deep understanding of key business industries and knowledge of products and services in the market. He is strongly committed to developing talent and inspires his team members to pursue a common vision.');
INSERT INTO `role` (`Role_Name`, `Role_Desc`) VALUES('Support Engineer', 'The Support Engineer undertakes complex projects related to system provisioning, installations, configurations as well as monitoring and maintenance of systems. He/She applies highly developed specialist knowledge and skills in systems administration and works toward continuous optimisation of system performance. He implements system improvements and instructs other IT staff in the resolution of most complex issues. He is required to be on standby with on-call availability with varied shifts including nights, weekends and holidays to resolve systems related incidents. He works in a team setting and is proficient in Infrastructure systems and Network related tools and techniques required by the organisation. He is also familiar with the relevant platforms on which the database is deployed on. The Support Team is able to quickly and effectively solve issues as they arise. He is able to methodically identify the cause of the issue, evaluate it and develop a solution in collaboration with the team. He is able to communicate effectively and displays high service level standards.');
INSERT INTO `skill` (`Skill_Name`, `Skill_Desc`) VALUES('Account Management', 'Manage, maintain and grow the sales and relationships with a specific customer or set of accounts. This includes in-depth customer engagement, relationship-building and provision of quality solutions and service to address customers'' needs efficiently and generate revenue.');
INSERT INTO `skill` (`Skill_Name`, `Skill_Desc`) VALUES('Accounting and Tax Systems', 'Implement accounting or tax software systems in the organisation');
INSERT INTO `skill` (`Skill_Name`, `Skill_Desc`) VALUES('Accounting Standards', 'Apply financial reporting framework prescribed by the relevant governing body to ensure all transactions meet regulatory requirements');
INSERT INTO `skill` (`Skill_Name`, `Skill_Desc`) VALUES('Applications Development', 'Develop applications based on the design specifications; encompassing coding, testing, debugging, documenting and reviewing and/or refining it across the application development stages in accordance with defined standards for development and security. The complexity of the application may range from a basic application to a context-aware and/or augmented reality application that incorporates predictive behaviour analytics, geo-spatial capabilities and other appropriate algorithms. The technical skill includes the analysis and possibly the reuse, improvement, reconfiguration, addition or integration of existing and/or new application components.');
INSERT INTO `skill` (`Skill_Name`, `Skill_Desc`) VALUES('Applications Integration', 'Integrate data or functions from one application program with that of another application program - involves development of an integration plan, programming and the identification and utilisation of appropriate middleware to optimise the connectivity and performance of disparate applications across target environments');
INSERT INTO `skill` (`Skill_Name`, `Skill_Desc`) VALUES('Applications Support and Enhancement', 'Provide ongoing technical support and improvements to users of applications. This includes technical guidance and assistance related to the installation and maintenance of applications, fixing and resolution of application problems or disruptions, and response to change requests that will enhance the operations and usage of an application');
INSERT INTO `skill` (`Skill_Name`, `Skill_Desc`) VALUES('Audit Compliance', 'Ensure compliance with corporate policies and guidelines');
INSERT INTO `skill` (`Skill_Name`, `Skill_Desc`) VALUES('Audit Frameworks', 'Develop quality assurance frameworks to meet regulatory requirements');
INSERT INTO `skill` (`Skill_Name`, `Skill_Desc`) VALUES('Automated Equipment and Control Configuration', 'Configure automated equipment and control systems to support biopharmaceuticals and manufacturing processes');
INSERT INTO `skill` (`Skill_Name`, `Skill_Desc`) VALUES('Budgeting', 'Prepare organisational budgets to support short- and long-term business plans through forecasting, allocation and financial policy setting.');
INSERT INTO `skill` (`Skill_Name`, `Skill_Desc`) VALUES('Business Acumen', 'Assess the impact of changes in the business organisation, environment, and industry');
INSERT INTO `skill` (`Skill_Name`, `Skill_Desc`) VALUES('Business Development', 'Develop and implement plans to enhance organisation''s business performance and growth');
INSERT INTO `skill` (`Skill_Name`, `Skill_Desc`) VALUES('Business Environment Analysis', 'Analyse data pertaining to the business landscape and environment, including competitor-analysis, trends and developments in laws and regulations and the impact on the business');
INSERT INTO `skill` (`Skill_Name`, `Skill_Desc`) VALUES('Business Needs Analysis', 'Identify and scope business requirements and priorities through rigorous information gathering and analysis as well as clarification of the solutions, initiatives and programmes to enable effective delivery. This also involves the development of a compelling and defensible business case and the articulation of the potential impact of the solution to the business');
INSERT INTO `skill` (`Skill_Name`, `Skill_Desc`) VALUES('Business Negotiation', 'Conduct negotiations to establish win-win outcomes for the organisation');
INSERT INTO `skill` (`Skill_Name`, `Skill_Desc`) VALUES('Business Presentation Delivery', 'Perform required tasks to prepare and present information in various business settings involving preparation, understanding of audience, delivery and tailoring of messages to be conveyed');
INSERT INTO `skill` (`Skill_Name`, `Skill_Desc`) VALUES('Business Requirements Mapping', 'Map business requirements to existing processes to identify gaps or opportunities for possible solutions and evaluate impact of solutions against requirements to propose adjustments as needed ');
INSERT INTO `skill` (`Skill_Name`, `Skill_Desc`) VALUES('Business Risk Management', 'Forecast and assess existing and potential IT risks which impact the operation and/or profitability to the business as well as the development and roll out of company-wide strategies and processes to mitigate risk, minimise their impact or effectively manage such business risks');
INSERT INTO `skill` (`Skill_Name`, `Skill_Desc`) VALUES('Call Centre Management', 'Implement and manage call centre operations to address queries and needs of customers');
INSERT INTO `skill` (`Skill_Name`, `Skill_Desc`) VALUES('Collaboration', 'Manage relationships and work collaboratively and effectively with others to achieve goals');
INSERT INTO `skill` (`Skill_Name`, `Skill_Desc`) VALUES('Communication', 'Convey and exchange thoughts, ideas and information effectively through various mediums and approaches');
INSERT INTO `skill` (`Skill_Name`, `Skill_Desc`) VALUES('Configuration Tracking', 'Track systematically and manage changes and revisions in software projects to ensure that all changes are accounted for and to protect assets against unauthorized change, diversion and inappropriate use');
INSERT INTO `skill` (`Skill_Name`, `Skill_Desc`) VALUES('Customer Acquisition Management', 'Develop customer acquisition strategies as well as foster customer relationships to attract new customers');
INSERT INTO `skill` (`Skill_Name`, `Skill_Desc`) VALUES('Customer Relationship Management', 'Initiate and drive activities to enhance customer relationships and brand loyalty for the organisation');
INSERT INTO `skill` (`Skill_Name`, `Skill_Desc`) VALUES('Data Analytics', 'Apply data extraction and analytic methods to analyse and evaluate financial and non-financial information and provide business intelligence');
INSERT INTO `skill` (`Skill_Name`, `Skill_Desc`) VALUES('Database Administration', 'Perform Installation, coordination and upgrading of databases and database servers, performance monitoring and troubleshooting. This includes monitoring user access to database and optimisation of database performance, planning for backup and recovery, archived data maintenance and reporting');
INSERT INTO `skill` (`Skill_Name`, `Skill_Desc`) VALUES('Developing People', 'Empower others to learn and develop their capabilities to enhance their performance and achieve personal or professional goals');
INSERT INTO `skill` (`Skill_Name`, `Skill_Desc`) VALUES('Digital Fluency', 'Leverage digital technology tools, systems, and software across work processes and activities to solve problems, drive efficiency and facilitate information sharing');
INSERT INTO `skill` (`Skill_Name`, `Skill_Desc`) VALUES('Employee Communication Management', 'Formulate overall employee communication strategies and facilitate conversations to ensure effective and timely dissemination of pertinent information to employees');
INSERT INTO `skill` (`Skill_Name`, `Skill_Desc`) VALUES('Employee Engagement Management', 'Drive employee engagement programmes to facilitate commitment from employees to organisational values, vision and objectives');
INSERT INTO `skill` (`Skill_Name`, `Skill_Desc`) VALUES('Finance Business Partnering', 'Generate finance-related insights to support the business in a strategic manner');
INSERT INTO `skill` (`Skill_Name`, `Skill_Desc`) VALUES('Financial Acumen', 'Exercise financial insight to establish budgets for human resource (HR) activities and monitor HR operations and outcomes against financial plans');
INSERT INTO `skill` (`Skill_Name`, `Skill_Desc`) VALUES('Financial Closing', 'Carry out month-end closing and reconciliation to ensure financial records are maintained properly');
INSERT INTO `skill` (`Skill_Name`, `Skill_Desc`) VALUES('Financial Management', 'Ensure healthy finance to aid business growth and operations');
INSERT INTO `skill` (`Skill_Name`, `Skill_Desc`) VALUES('Financial Planning', 'Evaluate and develop budget in line with organisation''s strategies and plans');
INSERT INTO `skill` (`Skill_Name`, `Skill_Desc`) VALUES('Financial Reporting', 'Prepare general-purpose financial statements and disclosure notes in accordance with applicable financial reporting framework');
INSERT INTO `skill` (`Skill_Name`, `Skill_Desc`) VALUES('Financial Statements Analysis', 'Analyse financial statements in accordance with the applicable frameworks');
INSERT INTO `skill` (`Skill_Name`, `Skill_Desc`) VALUES('Financial Transactions', 'Prepare business documentation and cash balances');
INSERT INTO `skill` (`Skill_Name`, `Skill_Desc`) VALUES('Human Resource Advisory', 'Deliver human resource (HR) advisory and consultancy services to internal and external clients to meet their requirements');
INSERT INTO `skill` (`Skill_Name`, `Skill_Desc`) VALUES('Human Resource Practices Implementation', 'Implement of human resource (HR) practices by integrating local and international requirements, guidelines and best practices');
INSERT INTO `skill` (`Skill_Name`, `Skill_Desc`) VALUES('Human Resource Strategy Formulation', 'Establish human resource (HR) strategies and priorities that are aligned with current and future business needs');
INSERT INTO `skill` (`Skill_Name`, `Skill_Desc`) VALUES('Human Resource Systems Management', 'Establish and manage effective and efficient human resource (HR) management systems');
INSERT INTO `skill` (`Skill_Name`, `Skill_Desc`) VALUES('Infrastructure Deployment', 'Set up, deploy and decommission infrastructure components and associated equipment in accordance to a set plan and established safety and/or quality procedures. This includes the assessment and preparation of appropriate site locations, infrastructure, the development of an installation plan, layout at the site, the testing of on-site systems, infrastructure components, equipment and the correction of issues and/or malfunctions');
INSERT INTO `skill` (`Skill_Name`, `Skill_Desc`) VALUES('Infrastructure Support', 'Provide services to end users by systematically identifying, classifying and troubleshooting technical issues and incidents that disrupt and impact their day-to-day business activities, within a specified timeframe. This also includes implementing an end-to-end problem management process to analyse underlying problems, advising on infrastructure related upgrades and improvements and developing user guides and training materials');
INSERT INTO `skill` (`Skill_Name`, `Skill_Desc`) VALUES('Learning and Development Programme Management', 'Establish and implement learning and development programmes and channels to facilitate employees'' growth and capability building');
INSERT INTO `skill` (`Skill_Name`, `Skill_Desc`) VALUES('Learning Needs Analysis', 'Identify the learning needs of the learners'' workplace, department or division in accordance to the Learning Needs Analysis Framework');
INSERT INTO `skill` (`Skill_Name`, `Skill_Desc`) VALUES('Network Administration and Maintenance', 'Monitor network in order to provide for optimum levels of network performance and minimisation of downtime. This includes detection, isolation, recovery and limitation of the impact of failures on the network as well as provision of support to system users through ongoing maintenance information sharing and training');
INSERT INTO `skill` (`Skill_Name`, `Skill_Desc`) VALUES('Onboarding', 'Facilitate onboarding programmes to enable the integration and engagement of new hires into the organisation');
INSERT INTO `skill` (`Skill_Name`, `Skill_Desc`) VALUES('Organisational Design', 'Develop and facilitate the implementation of organisational design to ensure its effectiveness and alignment with stakeholders'' priorities');
INSERT INTO `skill` (`Skill_Name`, `Skill_Desc`) VALUES('People and Performance Management', 'Establish and implement performance management and remuneration strategies in the organisation to drive business results');
INSERT INTO `skill` (`Skill_Name`, `Skill_Desc`) VALUES('Pricing Strategy', 'Analyse product, organisational and market factors, trends, pricing scenarios and valuation models to develop effective pricing strategies for products and solutions ');
INSERT INTO `skill` (`Skill_Name`, `Skill_Desc`) VALUES('Problem Management', 'Manage the lifecycle of problems to prevent problems and incidents from occurring, eliminate recurring incidents and minimise impact of unavoidable incidents');
INSERT INTO `skill` (`Skill_Name`, `Skill_Desc`) VALUES('Problem Solving', 'Generate effective and efficient solutions to solve problems and capitalise on new opportunities');
INSERT INTO `skill` (`Skill_Name`, `Skill_Desc`) VALUES('Product Management', 'Create and manage a product roadmap, involving the ideating, planning, forecasting, marketing and management of a product or a suite of products throughout stages of its lifecycle, from its conceptualisation to market entrance and eventual phasing-out. This includes the creation of a new product idea or concept and definition of the product strategy based on a projection of its potential benefits to the customer as well as the review of product performance against milestones and targets set ');
INSERT INTO `skill` (`Skill_Name`, `Skill_Desc`) VALUES('Professional and Business Ethics', 'Foster strong ethical standards and resolve ethical conflicts in accordance with the relevant principles and processes');
INSERT INTO `skill` (`Skill_Name`, `Skill_Desc`) VALUES('Project Management', 'Execute projects by managing stakeholder engagement, resources, budgets and resolving problems');
INSERT INTO `skill` (`Skill_Name`, `Skill_Desc`) VALUES('Regulatory Compliance', 'Comply with policies, procedures, and external regulations');
INSERT INTO `skill` (`Skill_Name`, `Skill_Desc`) VALUES('Regulatory Risk Assessment', 'Analyse the impact of latest global regulatory developments and relevant laws on overall audit and/or engagement strategies');
INSERT INTO `skill` (`Skill_Name`, `Skill_Desc`) VALUES('Regulatory Strategy', 'Align regulatory activities with business strategies');
INSERT INTO `skill` (`Skill_Name`, `Skill_Desc`) VALUES('Sales Closure', 'Perform numerical calculations and execute selling strategies to complete sales of products and services to the satisfaction of customers');
INSERT INTO `skill` (`Skill_Name`, `Skill_Desc`) VALUES('Sales Strategy', 'Develop a sales strategy, plan and targets, considering market potential, industry trends and various internal and external business factors as well as the evaluation and further refinement of the sales strategy');
INSERT INTO `skill` (`Skill_Name`, `Skill_Desc`) VALUES('Security Administration', 'Administer, configure and update of security programmes and mechanisms, including the application of system patches to ensure that enterprise assets are adequately protected against threats. This also includes the authorisation, management and monitoring of access control permissions and/or rights to various IT facilities');
INSERT INTO `skill` (`Skill_Name`, `Skill_Desc`) VALUES('Sense Making', 'Leverage sources of qualitative and quantitative information and data to recognise patterns, spot opportunities, infer insights and inform decisions');
INSERT INTO `skill` (`Skill_Name`, `Skill_Desc`) VALUES('Service Level Management', 'Plan, monitor and manage service provisions for the achievement of agreed service level targets');
INSERT INTO `skill` (`Skill_Name`, `Skill_Desc`) VALUES('Skills Framework Adoption', 'Drive the adoption, integration and implementation of Skills Frameworks and their components in business and human resources activities throughout the organisation');
INSERT INTO `skill` (`Skill_Name`, `Skill_Desc`) VALUES('Software Configuration', 'Configure software products, analytics and modelling solutions, and apply and/or modify scripts and automation tools to integrate and deploy releases to various platforms and operating environments ');
INSERT INTO `skill` (`Skill_Name`, `Skill_Desc`) VALUES('Software Design', 'Create and refine the overall plan for the design of software, including the design of functional specifications starting from the defined business requirements as well as the consideration and incorporation of various controls, functionality and interoperability of different elements into a design blueprint or model which describes the overall architecture in hardware, software, databases, and third party frameworks that the software will use or interact with');
INSERT INTO `skill` (`Skill_Name`, `Skill_Desc`) VALUES('Software Testing', 'Assess and test the overall effectiveness and performance of an application, involving the setting up of suitable testing conditions, definition of test cases and/or technical criteria ');
INSERT INTO `skill` (`Skill_Name`, `Skill_Desc`) VALUES('Solution Architecture', 'Design or refine a solution blueprint or structure to guide the development of IT solutions in hardware, software, processes or related components, to meet current and future business needs. The solution architecture developed may lead to broad or specific changes to IT services, operating models and processes, and should provide a framework to guide the development and modification of solutions');
INSERT INTO `skill` (`Skill_Name`, `Skill_Desc`) VALUES('Solutions Design Thinking', 'Solutions Design Thinking');
INSERT INTO `skill` (`Skill_Name`, `Skill_Desc`) VALUES('SOP Development and Implementation', 'Develop Standard Operating Procedures (SOPs) and implement procedures to ensure that process operational tasks for all modes of plant operation are performed correctly and consistently in accordance with regulatory and organisational objectives');
INSERT INTO `skill` (`Skill_Name`, `Skill_Desc`) VALUES('Stakeholder Management', 'Manage stakeholder expectations to ensure continuous levels of engagement by identifying and addressing needs, setting service standards and resolving issues in accordance with organisational procedures');
INSERT INTO `skill` (`Skill_Name`, `Skill_Desc`) VALUES('Strategy Planning', 'Develop organisational strategies and policies by analysing the impact of internal and external influencing factors and seeking consultation from relevant stakeholders.');
INSERT INTO `skill` (`Skill_Name`, `Skill_Desc`) VALUES('System Integration', 'Develop and implement a roadmap and specific integration solutions to facilitate integration of various ICT components and optimise inter-operability of systems and their interfaces. This includes the integration of various architectural components such as networks, servers, system platforms and their interfaces');
INSERT INTO `skill` (`Skill_Name`, `Skill_Desc`) VALUES('Talent Management', 'Drive talent management strategies and programmes to identify, develop, review and retain talent to meet the current and future organisational needs');
INSERT INTO `skill` (`Skill_Name`, `Skill_Desc`) VALUES('Tax Computation', 'Compute Goods and Services Tax, and tax liabilities');
INSERT INTO `skill` (`Skill_Name`, `Skill_Desc`) VALUES('Tax Implications', 'Assess tax implication of changes in tax laws');
INSERT INTO `skill` (`Skill_Name`, `Skill_Desc`) VALUES('Technology Application', 'Integrate technologies into operations of the organisation to optimise efficiency and effectiveness of processes');
INSERT INTO `skill` (`Skill_Name`, `Skill_Desc`) VALUES('Technology Integration', 'Integrate new and emerging technology products, services and developments to enhance human resource (HR) operations and service delivery');
INSERT INTO `skill` (`Skill_Name`, `Skill_Desc`) VALUES('Technology Road Mapping', 'Plan short-term and long-term goals with specific technology solutions to help meet those goals in order to make capital out of future market needs');
INSERT INTO `skill` (`Skill_Name`, `Skill_Desc`) VALUES('User Interface Design', 'Design user interfaces for machines and software, incorporating visual, technical and functional elements that facilitate ease of access, understanding and usage. This would involve adding, removing, modifying or enhancing elements to make the user''s interaction with the product as seamless as possible');
