INSERT INTO `role_listing` (`id`, `Role_Name`, `Start_Date`, `End_Date`, `Manager_ID`, `Country`) VALUES(34, 'Call Centre', '2023-10-26', '2023-11-02', 190077, 'Malaysia');
INSERT INTO `role_listing` (`id`, `Role_Name`, `Start_Date`, `End_Date`, `Manager_ID`, `Country`) VALUES(35, 'Consultancy Director', '2023-10-26', '2023-12-06', 151410, 'Indonesia');
INSERT INTO `role_listing` (`id`, `Role_Name`, `Start_Date`, `End_Date`, `Manager_ID`, `Country`) VALUES(36, 'Consultant', '2023-10-26', '2023-10-28', 150866, 'Indonesia');
INSERT INTO `application` (`id`, `Listing_ID`, `Staff_ID`, `App_Desc`, `App_Date`) VALUES(3, 36, 140002, 'Some nice stuff about myself', '2023-10-26');
INSERT INTO `application` (`id`, `Listing_ID`, `Staff_ID`, `App_Desc`, `App_Date`) VALUES(4, 35, 140002, 'As a Director in engineering, I am a dynamic individual with a strong background in technical expertise and leadership skills. With a keen eye for detail and a strategic mindset, I am dedicated to ensuring project success while fostering a collaborative and innovative work environment. I possess excellent interpersonal and communication skills, allowing me to effectively communicate with cross-functional teams and stakeholders at all levels. Leveraging my extensive industry knowledge and experience, I thrive in driving efficiency, implementing best practices, and making informed decisions to achieve optimal results. My passion for engineering, coupled with my ability to inspire and motivate teams, makes me a valuable asset in the role of Director.', '2023-10-26');
INSERT INTO `application` (`id`, `Listing_ID`, `Staff_ID`, `App_Desc`, `App_Date`) VALUES(5, 34, 140002, 'As a Call Centre Executive, I am a customer-focused professional with a passion for delivering exceptional service. With a strong background in handling customer inquiries, resolving issues, and managing high call volumes, I am dedicated to ensuring customer satisfaction at all times. I possess excellent communication and problem-solving skills, allowing me to effectively handle challenging situations and provide accurate information to customers. I am highly organized and detail-oriented, ensuring that all customer interactions are documented accurately and efficiently. My ability to multitask and work well under pressure enables me to meet and exceed performance targets, while maintaining a positive and professional attitude. As a Call Centre Executive, I am committed to creating positive customer experiences and contributing to the overall success of the team.', '2023-10-26');
INSERT INTO `application` (`id`, `Listing_ID`, `Staff_ID`, `App_Desc`, `App_Date`) VALUES(6, 36, 140893, 'Self-description for a Consultant Role:\n\nAs an experienced consultant, I bring a unique blend of expertise, strategic thinking, and exceptional problem-solving skills to every project I undertake. With a passion for delivering measurable results and driving impactful change, I am dedicated to helping organizations achieve their goals and overcome their challenges.\n\nMy professional background includes a successful track record in providing consultancy services across various industries, including but not limited to finance, technology, and marketing. I have been entrusted with advising clients of all sizes, from startups to Fortune 500 companies, offering valuable insights and innovative strategies to optimize processes, improve efficiency, and enhance overall performance.\n\nOne of my key strengths lies in my ability to quickly understand complex business environments and identify areas for improvement. I have a sound analytical mindset, combined with a strong expertise in data analysis and research, allowing me to accurately assess client needs and develop comprehensive recommendations tailored to their specific circumstances.\n\nI am known for my excellent communication skills, which enable me to effectively articulate ideas and concepts to clients at all levels of the organization. I am equally comfortable providing clear instructions to operational staff as I am presenting findings and proposals to C-level executives. My ability to build strong, professional relationships allows me to establish trust with clients and collaborate seamlessly with stakeholders to drive successful outcomes.\n\nIn addition to my technical skills, I am a continuous learner, always staying up to date with the latest industry trends and best practices. I actively seek opportunities to expand my knowledge and skill set through professional development courses and certifications, ensuring that I am equipped with the most relevant information and tools to deliver top-notch consultancy services.\n\nOverall, I am a highly motivated and results-driven consultant with a deep passion for helping organizations succeed. With my combination of industry expertise, excellent problem-solving abilities, and strong interpersonal skills, I am confident in my ability to make a positive impact and deliver exceptional value to any consulting project I am involved in.', '2023-10-26');
